import React from "react";
import { Helmet } from "react-helmet";
import BreedListing from "../components/breed-listing";
import "./breeds-page-drop";

function BreedsPage(props) {
  return (
    <main>
      <Helmet>
        <title>Breeds</title>
        /+<div class="dropdown">
          <button class="dropbtn">Size</button>
          <div class="dropdown-content">
            <a href="#">S</a>
            <a href="#">M</a>
            <a href="#">L</a>
            <a href="#">XL</a>
          </div>
        </div>
      </Helmet>
      <BreedListing {...props} />
    </main>
  );
}

export default BreedsPage;
